import react from "react";
import { View, Text, StyleSheet } from "react-native";

const SearchBar = () => {
  return (
    <View style={styles.background}>
      <Text>Search Bar</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  background: {
    backgroundColor: "#F0EEEE",
    height: 0,
    borderRadius: 5,
  },
});

export default SearchBar;
